import React from "react";
import { Link, redirect } from "react-router-dom";
import { LockOutlined, MailOutlined, UserOutlined } from "@ant-design/icons";
import { Button, Checkbox, Form, Input } from "antd";
import Swal from "sweetalert2";
import "./Login.css";

import { signInWithGoogle } from "./firebase";

// import { GoogleAuthProvider, getAuth, signInWithPopup } from "firebase/auth";

const Login = () => {
  // const provider = new GoogleAuthProvider();

  // const auth = getAuth();

  // const googleLogin = () => {
  //   signInWithPopup(auth, provider)
  //     .then((result) => {
  //       const credential = GoogleAuthProvider.credentialFromResult(result);
  //       const token = credential.accessToken;
  //       const user = result.user;
  //       console.log(result.user.displayName);

  //       // window.location.href = "http://localhost:3000/";
  //     })
  //     .catch((error) => {
  //       const errorCode = error.code;
  //       const errorMessage = error.message;
  //       const email = error.customData.email;
  //       const credential = GoogleAuthProvider.credentialFromError(error);
  //     });
  // };

  const onFinish = (values) => {
    console.log("Received values of form: ", values);
    let mail = "thong1403@gmail.com";
    let pass = "123456";

    if (values.email === mail && values.password === pass) {
      Swal.fire("Login Successful!", "Logged in successfully!", "success");
      window.location.href = "http://localhost:3000/";
      localStorage.setItem("userEmail", values.email);
    } else {
      Swal.fire({
        icon: "error",
        title: "Oops...",
        text: "Incorrect email or password!",
      });
    }
  };

  return (
    <>
      <div className='nabar'>
        <img
          src='https://tuyendung.rikkeisoft.com/assets/front/images/logoRikkeisoft.png'
          alt=''
          className='img'
        />
      </div>
      <div className='container'>
        <div className='row'>
          <div className='col-6'>
            <h3 className='title'>
              Welcome to
              <img
                src='https://tuyendung.rikkeisoft.com/assets/front/images/logoRikkeisoft.png'
                alt=''
                className='img-title'
              />
            </h3>
            <Form
              name='normal_login'
              className='login-form'
              initialValues={{
                remember: true,
              }}
              onFinish={onFinish}
            >
              <Button className='login' onClick={signInWithGoogle}>
                <img
                  src='https://www.freepnglogos.com/uploads/google-logo-png/google-logo-png-webinar-optimizing-for-success-google-business-webinar-13.png'
                  alt=''
                  className='logo'
                />
                <b> Đăng nhập bằng Google</b>
              </Button>
              <Form.Item
                name='email'
                rules={[
                  {
                    required: true,
                    message: "Please input your Email!",
                  },
                ]}
              >
                <Input
                  prefix={<MailOutlined className='site-form-item-icon' />}
                  placeholder='email'
                  className='input'
                />
              </Form.Item>
              <Form.Item
                name='password'
                rules={[
                  {
                    required: true,
                    message: "Please input your Password!",
                  },
                ]}
              >
                <Input
                  prefix={<LockOutlined className='site-form-item-icon' />}
                  type='password'
                  placeholder='Password'
                  className='input'
                />
              </Form.Item>
              <Form.Item>
                <Form.Item name='remember' valuePropName='checked' noStyle>
                  <Checkbox className='check'>Remember me</Checkbox>
                </Form.Item>

                <a
                  className='login-form-forgot'
                  href='https://ant.design/components/form'
                >
                  Forgot password
                </a>
              </Form.Item>

              <Form.Item>
                <Button
                  type='primary'
                  htmlType='submit'
                  className='login-form-button'
                >
                  <b className='login-title'> Log in</b>
                </Button>
                <div>
                  <Button className='login'>
                    <img
                      src='https://upload.wikimedia.org/wikipedia/commons/thumb/5/51/Facebook_f_logo_%282019%29.svg/2048px-Facebook_f_logo_%282019%29.svg.png'
                      alt=''
                      className='logo'
                    />
                    <b>Đăng nhập bằng FaceBook</b>
                  </Button>
                </div>
                <div>
                  Do not have an account?
                  <Link to='/signup'>register now!</Link>
                </div>
              </Form.Item>
            </Form>
          </div>
          <div className='col-6'>
            <img
              src='https://scontent.fhan17-1.fna.fbcdn.net/v/t39.30808-6/316123851_598932872033570_9104117166778453158_n.jpg?_nc_cat=109&ccb=1-7&_nc_sid=e3f864&_nc_ohc=UVIy69WnxFsAX_hj-MU&_nc_ht=scontent.fhan17-1.fna&oh=00_AfA1Sf8PvYomUIPg-_eUDQ9OsJQIHYAG57w0n6b0cdSq0w&oe=6396A5BF'
              alt=''
              className='img-content'
            />
          </div>
        </div>
      </div>
    </>
  );
};

export default Login;
